import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import Navbar from '../layout/Navbar';

const Dashboard = (props) => {
  return (
    <div>
      <Navbar />
      <div className="dash-container">
        <p>Dashboard</p>
      </div>
    </div>
  );
};

Dashboard.propTypes = {

};

export default Dashboard;
